window.bookSummaryJSON = "No one likes to be alone during the holidays. For New York's most posh dating service, Personally Yours, it is the season to bring lonely hearts together. But Lt. Eve Dallas, on the trail of a ritualistic serial killer, has made a disturbing discovery: all of the victims have been traced to Personally Yours. Eve soon enters an elite world of people searching for their one true love - and one killer searching for his next victim."; 
